евый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "658": ["Коврик пришел целый. Подрезала под свой противень. А обрезки тестировала на прочность. Если просто тянуть в стороны - не так просто разорвать, несмотря на то, что ковер тонкий. А вот если сделать залом - рвется как бумага. Так что лучше не сгибать. \r\n\r\nПрочитала в отзывах, что у кого-то прилипла свинья под сыром, не отодрать. Пекла куриное филе в панировке, переживала и за коврик и за то, что останусь без курочки. Ну вот результат видно на фото. \r\n\r\nЕще намазывала коржи для медовика прямо на противень. Дважды. Второй корж после выпечки первого, без мытья ковра - оба отошли хорошо.\r\n\r\nМинусы: \r\n- на коврике остаются контуры пищи, которая запеклась на нем в духовке, как его не мой. \r\n- из-за того, что его легко заломать, а потом случайно порвать по залому, мыть его желательно развернутым на противне, это, все же, не оч удобно.", "2020-10-10T21:05:16Z", "серо-бежевый", "0", 3, 1, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "660": ["Заказала 2 коврика особопрочных. Каждый пришёл в картонной коробке. Пока не использовала.", "2020-10-02T19:33:22Z", "коричневый", "0", 4, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "662": ["Коврик отличный прошёл испытание, запекла рыбу все отлично нечего не пригорело. ", "2020-10-10T13:34:30Z", "серо-бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "663": ["Коврик просто супер!!! 100 баллов👍", "2020-10-10T11:48:38Z", "коричневый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "664": ["Отличный товар. Пришёл хорошо упакован", "2020-10-10T10:29:30Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 