ак раз для моего противня. Удобно хранить его в тубусе, который идёт в комплекте. Всем рекомендую. ", "2020-10-04T18:34:36Z", "серо-бежевый", "0", 12, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "675": ["Бисквитный рулет прилип на этой бумаге. ", "2020-10-03T15:18:38Z", "серо-бежевый", "0", 0, 1, 3, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "676": ["Хороший коврик, пока не использовала. Пришёл хорошо упакованный. ", "2020-10-02T16:11:33Z", "серо-бежевый", "0", 0, 1, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "677": ["Отличный коврик, ничего не прилипает!!", "2020-10-02T15:37:48Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "680": ["отличные коврики!! супер!!", "2020-10-01T09:33:07Z", "коричневый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "684": ["Хороший коврик. На стандартный противень хватает вполне. Пекла на нем дрожжевые пирожки. Обычно они снизу пригорали в моей газовой духовке. При использовании коврика, низ пирожков не пригорел. Легко моется. Не пахнет ничем химическим. Отрицательных качеств не выявила))", "2020-09-28T18:42:16Z", "коричневый", "0", 6, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "685": ["Коврик получила но пока не пользовалась", "2020-09-28T18:13:26Z", "бежевый", "0", 0, 4, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "687": ["Заказ пришел быстро,  хорошо упакован. В функциональности пока не пробовала, позже отпишусь", "2020-09-28T18:12:38Z", "серо-бежевый", "0", 1, 1, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "688": ["Пока не пробовала в деле, на вид хороший. Ожидала что будет побольше", "2020-09-28T15:09:29Z", "серо-бежевый", "0", 0, 2, 4, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "689": ["Тоненькая. Храню между досками для разделки", "2020-09-28T11:40:35Z", "бежевый", "0", 0, 1, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "691": ["Коврик просто замечательный! Первое, что запекали на нем - картофель с грибами, и когда он прилип к коврику, успела разочароваться в нём. Но в принципе все очень легко отмылось водой. А вот тесто...какое бы не положила, вообще не прилипает. Пекла овсяное печенье с довольно жидким тестом - печеньки после приготовления сами соскальзывали с коврика. Раскатывала на нём и сразу же пекла ооочень липкое тесто для хлебцев - все опять же на 5+.", "2020-09-28T05:29:35Z", "коричневый", "0", 6, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "692": ["Просто топчик,  ничего не прилипает", "2020-09-28T04:18:23Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "694": ["Отличный берите не пожалеете выпечка класс👍", "2020-09-27T16:46:10Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "696": ["Коврик понравился, выпекала даже не смазывая, ничего не прилипло, запаха нет, протерла мыльной тряпкой и промыла водой.", "2020-09-26T18:30:01Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "697": ["Заказала коврик, а он оказался  разрезанный на половину! Очень жаль! На фото хорошо видент разрез", "2020-09-26T12:47:56Z", "серо-бежевый", "0", 1, 1, 1, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "702": ["Офигенная штука! По размеру четко в противень лег коврик от духовки) ничего не прилипает, быстро моется! В бумаге для выпечки больше не вернусь))", "2020-09-24T07:08:45Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "703": ["Немного огорчили темные пятнышки на коврике, думала оттереть - не получилось.", "2020-09-10T10:14:33Z", "серо-бежевый", "0", 1, 0, 4, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "709": ["Очень хороший, он мне оказывается очень был необходим. Теперь только на нем запекаю!", "2020-09-21T10:42:40Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "710": ["На вид все отлично. Пока не пробовала", "2020-09-20T18:15:22Z", "бежевый", "0", 0, 1, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "711": ["Вместо антипригарного коврика прислали рукава для запекания.", "2020-09-20T10:59:49Z", "серо-бежевый", "0", 0, 1, 1, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "713": ["Классный коврик. Запаха нет. Ничего не прилипает и отлично моется. Спасибо.", "2020-09-19T12:59:46Z", "серо-бежевый", "0", 4, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "716": ["Очень тонкий коврик, но прочный. Отмывается очень легко. Хранить лучше скручивая, не складывая.", "2020-09-19T08:40:13Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, (30 см. х 40 см. или 33 см. х 40 см.)", "ERPELFIT"], "717": ["Коврик хороший, но то-ли я не поняла, то ли ещё что-то. В описании два размера, а пришёл только один коврик. В пункте выдачи сразу не проверила", "2020-09-18T08:28:27Z", "коричневый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "719": ["Отличный коврик, сразу же протестировали.Ничего не пригорает, легко моется, по размеру как раз на противень.Супер вещь!", "2020-09-16T19:00:37Z", "серо-бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "721": ["Привезли совсем не тот коврик, а какую то плёнку.... Возврат, обидно (((", "2020-09-15T15:03:44Z", "серо-бежевый", "0", 0, 2, 2, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "723": ["Хороший коврик. Размер как раз на лист духовки. Ничего не прилипает. Хорошо и легко отмывается.", "2020-09-14T19:48:39Z", "серо-бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "724": ["Хорошо, что накручен на трубку, без заломов.", "2020-09-14T10:46:08Z", "бежевый", "0", 2, 1, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "726": ["Отличный коврик, ничего не прилипло.", "2020-09-13T16:27:10Z", "серо-бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "727": ["На вид отличный коврик, в деле ещё не пробовала. Пришёл на втулке в целофане.", "2020-09-13T09:20:12Z", "серо-бежевый", "0", 0, 1, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "731": ["Коврик пришел в хорошей упаковке и был сразу опробован. Просто сказка, ничего не прилипло не прижарилось! Даже подвытекшее и запекшееся повидло просто убралось мокрой тряпочкой! Я очень довольна!", "2020-08-25T14:16:01Z", "бежевый", "0", 11, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "732": ["Коврик супер! отлично справляется со своей задачей. Однозначно закажу ещё один в будущем, спасибо!", "2020-09-11T11:04:10Z", "серо-бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "733": ["Коврик пришёл в простой коробке, без намотки на втулку. Материал указан лакоткань! Безопасен ли он? Есть сомнения в применении", "2020-09-11T05:24:13Z", "коричневый", "0", 3, 0, 1, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "734": ["После первого применения коврик понравился. Без всяких усилий отошёл от бисквита. Жаль видео нельзя подкрепить, на фото скрин видео как отходит коврик от бисквита. Никаким маслом не смазывала.", "2020-09-10T18:54:13Z", "бежевый", "0", 5, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "735": ["Ковриком довольно. Пару раз пекла сырники, кабачковые оладьи и оладьи из тыквы, запекала котлеты. Все без масла и очень этому довольна, так как на обычной сковороде все очень жирное получается. Для тех кто придерживается ПП супер удобная вещь.", "2020-09-09T22:21:58Z", "бежевый", "0", 3, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "736": ["Обычный коврик, функцию выполняет", "2020-09-08T16:13:34Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "737": ["Замечательный коврик, мечта хорошей хозяйки, экономит время и бережёт здоровье, не надо ни чего скрести и замачивать, просто праздник!", "2020-09-08T10:49:25Z", "коричневый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "738": ["Очень довольна. Увидела у друзей и сразу на вайлдберис заказала!", "2020-09-06T16:47:06Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "739": ["Суперский. Ничего не прилипает", "2020-08-31T04:57:39Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "740": ["Отличный коврик.Пекла коржи для \"молочной девочки\",не смазывала, всё хорошо отходит,ни чего не прилипает,моется легко.", "2020-08-31T03:56:38Z", "коричневый", "0", 3, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "741": ["Прекрасный коврик, ничего не пригорает, легко моется. Рекомендую !", "2020-08-30T08:39:07Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "742": ["Брала обычный и особопрочный. Обычный тонкий и пропитывается маслом при выпечке. Особопрочный как бы глянцевый, не впитывает в себя масло, ну и понадёжнее выглядит. Оба со своей функцией справляются. Рекомендую брать особопрочный.", "2020-08-29T20:06:46Z", "коричневый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "743": ["Тонкая, может мяться , но ничего не прилипает, моется легко", "2020-08-29T12:59:32Z", "коричневый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "744": ["Очень хороший тефлоновый коврик. Выпекала меренги . Все четко, ничего не прилипло. От коврика отстают хорошо.", "2020-08-29T12:27:31Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "745": ["По виду коврик неплохой, постороннего запаха нет. Попробуем позже в деле.", "2020-08-27T11:14:24Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "746": ["Пришел коврик, все идеально, спасибо! Давно искала именно такой, чтобы можно было готовить без масла и бумаги.", "2020-08-22T19:55:58Z", "бежевый", "0", 4, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "748": ["Коврик пришел без заломов, в духовке не деформировался, размер как раз подходит под противень. Выпекала на нем безе. Безешки от него отодрались только с помошью лопатки. И его отвратительно неудобно мыть, пришлось приложить немало усилий, чтобы отскрести от него остатки безе. Разочарована.", "2020-08-15T14:38:07Z", "серо-бежевый", "0", 5, 7, 2, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "749": ["Решила дать этому куску гэ еще один щанс с мясом (предварительно отмыв с него безе с большим трудом). Никогда так мясо не горело ни на пергамение, ни на фольге, а на этом убожестве теперь такая гарь, что место ему в помойке. Ужасный товар, не рекомендую никому!", "2020-08-23T15:20:22Z", "серо-бежевый", "0", 0, 8, 1, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "750": ["Неплохой коврик,думала будет немного плотнее,но и такой подойдет", "2020-08-23T05:15:11Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "751": ["Моя очередная удачная покупка!!! Сразу использовала в действии! Бисквит, пончики ничего не прилипло!!! Я очень довольна!!!  Сам лист без заломов, удобно хранить в тубусе.", "2020-08-20T11:12:41Z", "бежевый", "0", 4, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "752": ["Готовила меренговый рулет. Белки при запекании прилипли и не смогла отодрать( смысл тогда этого коврика? выкинула, даже мыть не стала", "2020-08-18T18:35:04Z", "бежевый", "0", 3, 4, 1, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "753": ["у меня не было расслоения сахара и яичных белков. Готовлю не в первый раз, всегда всё хорошо взбиваю. И я добавляла сахарную пудру. Просто всё прилипло(", "2020-08-19T09:36:05Z", "бежевый", "0", 1, 0, 1, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "754": ["Коврик получила в хорошем состоянии, к упаковке претензий нет. Запекала фаршированные кабачки и при высоком нагреве появился химический запах, как будто проводка горит. При повторном запекании,но уже без коврика, в самом начале снова был запах, потом исчез. Вопрос к производителю: токсично ли данное изделие и насколько? или оно безвредно?", "2020-08-19T02:06:21Z", "серо-бежевый", "0", 2, 1, 4, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "755": ["Качественный коврик, прочный. Не пригорает, моется легко 👍", "2020-08-15T17:33:10Z", "бежевый", "0", 5, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "756": ["Коврик опробован, выше всяких похвал! Спасибо!", "2020-08-18T22:01:37Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "757": ["Замечательный коврик! На всякий случай смазала чуть-чуть растительным маслом, коржи для тортика отделились отлично! Моется удобно мягкой губкой или тряпочкой, предварительно расстелив его на столе.", "2020-08-17T16:55:08Z", "бежевый", "0", 8, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "758": ["Отличный коврик, только вот по ширине 3 см мне не хватает чтоб на весь противень лёг, конечно ничего не пригорела, но думала если честно будет на много толще и не такой как сказать прям нежный, как бумага тоненький, приготовила на коврике первый раз маковый рулет! ", "2020-08-17T15:18:13Z", "бежевый", "0", 4, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "759": ["Очень хорошая вещь, ничего не пригорает, буду брать второй. Чтобы не было заломов-мыть нужно на горизонтальной поверхности, можно протереть тряпочкой.", "2020-08-17T14:09:21Z", "серо-бежевый", "0", 3, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "760": ["Отличное качество. Пришёл быстро в хорошей упаковке. Спасибо!", "2020-08-03T16:50:55.482498161Z", "серо-бежевый", "0", 3, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "762": ["В восторге. Коврик не надо смазывать, изделия не прилипают, после приготовления легко протирается, удобная туба для хранения. Браво производителю!!!", "2020-08-14T23:41:38Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "763": ["Отличный коврик! Наконец то нашла то, что нужно! Прекрасно располагается на противне, не заламывается. После приготовления достаточно протереть влажной тряпочкой. Рекомендую хозяюшки!", "2020-08-14T09:08:17Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "764": ["Очень тонкий коврик. После одной выпечки и помывки измялся как бумага, порвался в нескольких местах и выброшен.", "2020-08-13T15:00:11Z", "бежевый", "0", 1, 1, 2, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "765": ["Заказала этот коврик, прочитав коментарии и не ошиблась! Для меня было важно, чтобы небыло заломов на новом коврике. Коврик приходит накрученный на тубус, в нём же и хранится. Коврик отличный в использовании! Запекала кабачки кольцами с сыром. Сыр немного вытек. Всё легко отмылось и коврик как новый! Хочу заказать ещё один, для выпечки слоеных тортов.", "2020-08-11T16:11:39Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "766": ["Приготовила на нем крышечки для Макаронс. Не приклеились, как на силиконовом! Хороший коврик, надеюсь, прослужит долго. ", "2020-08-10T18:32:59Z", "бежевый", "0", 9, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "767": ["Пекла пирожки с вишней. Начинка вытекла и подгорела пока бегала с домашними делами. Коврик протёрла тряпочкой и ни пятнышка. Я в восторге! Пекла ржаной подовый хлеб- просто изумительно себя ведёт. Однозначно рекомендую к покупке. Заказала второй))", "2020-08-10T16:11:03Z", "коричневый", "0", 4, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "768": ["Сколько искала коврики всё не то( а этот просто огонь ни капельки не пригорает и моется очень хорошо без усилий)))рекомендую к покупке!", "2020-08-09T12:52:27Z", "бежевый", "0", 2, 1, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "769": ["Пекла пирожки, запекала мясо- отличный коврик. Моеться на ура, подходит на мой противень с запасом.Очень довольна.", "2020-08-09T12:28:49Z", "серо-бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "770": ["Хороший коврик! Пришёл без заломов. Будем пробовать в деле)", "2020-08-09T08:08:29Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "772": ["Отличный коврик: выпек, протер, свернул - и все, - как новый! Еще не проверяла на хлебе с высокими температурами, а для остальной выпечки - прекрасно, ничего не прилипает, в размер противня, везде чисто и аккуратно.", "2020-08-07T13:47:20Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "773": ["Пришел коврик порезанный в 4-х местах. Возврат одобрили. Заметила дома, когда развернула. Проверяйте при получении.  Размер 30*40.", "2020-08-04T05:05:44Z", "бежевый", "0", 2, 0, 3, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см. и 33 см. х 40 см.", "ERPELFIT"], "776": ["Коврик пришел с небольшим заломом, но не критично. Намотан на картонную трубку. Тонкий лист, без запаха, размер идеален для противня в духовку 30*40, как заявлено в описании. Готовить пока не пробовала, брала 2. После дополню отзыв. Спасибо.", "2020-07-28T20:08:23.470473786Z", "бежевый", "0", 1, 1, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см.", "ERPELFIT"], "781": ["Заказываю второй такой и странно. Не тот размер, что ранее присылали, не та упаковка. На фото Нижний ранее более большой. Коврик помятый....", "2020-07-29T13:33:40.179400938Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см.", "ERPELFIT"], "783": ["Для меня этот коврик большая находка, очень люблю печь. Просто суперский, не прилипает, помыл и все, пользуйся сколько хочешь и не нужно тратиться на фольгу или пергамент, идеально подходит на протвинь духовки. Однозначно советую к покупке.", "2020-07-22T10:50:37.420513816Z", "бежевый", "0", 2, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см.", "ERPELFIT"], "784": ["Советую!!! 100%", "2020-07-20T15:48:27.832839189Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 30 см. х 40 см.", "ERPELFIT"], "786": ["Замечательно.  Ничего не прилипает, очень довольна.", "2020-07-11T17:56:57.7895915Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 33 см. х 40 см.", "ERPELFIT"], "787": ["Отличный коврик. Ничего не липнет к нему, помыл после готовки и , как новенький.", "2020-07-11T16:48:39.709974517Z", "бежевый", "0", 2, 1, 5, "Тефлоновый антипригарный коврик для выпечки, 33 см. х 40 см.", "ERPELFIT"], "788": ["Классный,котлеты готовила,никаких следов не осталось))", "2020-07-10T14:07:15.297926264Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 33 см. х 40 см.", "ERPELFIT"], "789": ["Очень удобный коврик, ничего не прилипает, готовить очень удобно на нем.", "2020-06-29T11:17:56.440048685Z", "бежевый", "0", 1, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 33 см. х 40 см.", "ERPELFIT"], "790": ["Отличный коврик, размер подходящий даже для большого листа-противня. Спасибо!", "2020-06-10T18:24:17.206727553Z", "бежевый", "0", 9, 0, 5, "Тефлоновый антипригарный коврик для выпечки, 33 см. х 40 см.", "ERPELFIT"]}
